      <Part part={props.parts[2].name} exercises={props.parts[2].exercises}/>
    </div>
  )
}

const Total = (props) => {

  return (
    <div>
      Number of exercises {props.parts[0].exercises + props.parts[1].exercises + 
      props.parts[2].exercises}
    </div>
  )
}

const Part = (props) => {

  return (
    <p>
      {props.part} {props.exercises}
    </p>
  )
}

